import { SocketContext } from "../SocketContext";


export default function VideoCall()
{
    const {name,callAccepted,myVideo,userVideo,callEnded,stream,callUser} = useContext(SocketContext);
        useEffect(()=>{
             callUser();   
        },[])
        
        return <div>
                <h1>HIII</h1>
                {stream&&
                <div>
                <video playsInline muted ref={myVideo} autoPlay className="video-div"/>
                </div>}
                {callAccepted&&!callEnded&&
                <div>
                <video playsInline muted ref={userVideo} autoPlay className="video-div"/>
                </div>}
        </div>
}
